import React from "react";
import { useState } from "react";

const countAVE = (companyData: any[], prosType: string): number => {
  const [commuteAve, setCommuteAve] = useState(0);

  companyData?.map((item: any) => {
    const aveArray: number[] = [];
    console.log("item.commute:", item.commute);
    aveArray.push(item.commute);
    console.log("나도 길이가 2여야댕..", aveArray.length);
    let commuteTotalResult: number = aveArray.reduce(
      (total: number, value: number) => (total += value),
      0
    );
    console.log("commuteTotalResult는 commute의 총합", commuteTotalResult);
    let commuteAve = commuteTotalResult / aveArray.length;
    console.log("난 평균값이야", commuteAve);
    setCommuteAve(commuteAve);
    return { commuteAve };
  });
  return commuteAve;
};

export default countAVE;
